import './ListPage.scss';
import {axios} from 'axios';


const ListPage = () => {
    axios
        .post("http://www.stock-manage-api.p-e.kr/login", {
            
        })
        .then((res) => {
            console.log("handleLogin =>", res);
            
        })
        .catch((e) => {
            console.error(e);
        });
    return (
        <div className="ListPage">
            <div className="sortBy">
                <div>No.</div>
                <div>제조사</div>
                <div>품명</div>
                <div>규격</div>
                <div>단위</div>
                <div>수량</div>
                <div>단위</div>
            </div>
            <div className="list">

            </div>
        </div>
    )
}

export default ListPage;
